	('93926fe5-df7d-473d-84a1-91529b5ac113', NULL, 'Facebook Ads hedefleme için:\n\n- **Yaş**: 25-45 arası\n- **İlgi Alanları**: E-ticaret, online alışveriş\n- **Davranış**: Online alışveriş yapanlar\n- **Yerleşim**: Hedef ülkeler\n\nBu kriterlerle başlayıp sonuçlara göre optimize edebilirsiniz.', 'cd9bf9ec-f2ef-4672-87e4-428fb1b5241e', true, '2025-08-25 21:42:52.148335+00', '2025-08-25 21:42:52.148335+00', NULL, false, 0, NULL),
	('53eb2803-4b12-4b62-ad09-34c75d5a077b', NULL, 'Danışman atama süreci:\n\n1. **Başvuru**: 24 saat içinde değerlendirme\n2. **Eşleştirme**: Firma profiline uygun danışman\n3. **İlk görüşme**: 48 saat içinde\n4. **Süreç**: 3-5 iş günü\n\nKriterler: Sektör deneyimi, başarı oranı ve uygunluk.', 'cd9bf9ec-f2ef-4672-87e4-428fb1b5241e', true, '2025-08-25 21:42:52.148335+00', '2025-08-25 21:42:52.148335+00', NULL, false, 0, NULL),
	('2a1a9fac-5fda-476f-9346-be822badeae3', NULL, 'Önerileriniz için teşekkürler! Geliştirme planımızda:\n\n- **Mobil Uygulama**: Q2 2024\n- **Gelişmiş Raporlama**: Q1 2024\n- **Push Notifications**: Q2 2024\n\nBu özellikler öncelikli olarak geliştirilecek.', 'cd9bf9ec-f2ef-4672-87e4-428fb1b5241e', true, '2025-08-25 21:42:52.148335+00', '2025-09-02 00:54:13.901403+00', NULL, false, 0, NULL);
